import {Component} from 'react'
import logo from './logo.svg';
import './App.css';

class App extends Component {
  constructor(){
    super()
    this.state={
      name :{firstname:"Yeshwanth",lastname:"Danthuluri"},
      company:"Enmovil"
    } 
  }
  render (){
    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <p>
           Hi, I'm {this.state.name.firstname} {this.state.name.lastname}, I work at {this.state.company}
          </p>
          <button 
          onClick={()=>{
            this.setState({
              name:"Yeshwanth"
            })
            console.log(this.state,"22")
          }}>Change Name</button>
        </header>
      </div>
    );
  }
}

export default App;
